import {BrowserRouter, Route} from "react-router-dom";
import Main_page from "./components/pages/Main_page";

function App() {
  return (
    <BrowserRouter>
        <Route path="/" element={Main_page} />
    </BrowserRouter>
  );
}

export default App;
